import{_ as e,c as t,a2 as o,o as r}from"./chunks/framework.BQmytedh.js";const b=JSON.parse('{"title":"其他设置","description":"","frontmatter":{},"headers":[],"relativePath":"basics/other.md","filePath":"basics/other.md","lastUpdated":1732412554000}'),h={name:"basics/other.md"};function i(l,a,s,n,d,c){return r(),t("div",null,a[0]||(a[0]=[o('<h1 id="其他设置" tabindex="-1"><strong>其他设置</strong> <a class="header-anchor" href="#其他设置" aria-label="Permalink to &quot;**其他设置**&quot;">​</a></h1><h2 id="_1-角色" tabindex="-1">（1）角色 <a class="header-anchor" href="#_1-角色" aria-label="Permalink to &quot;（1）角色&quot;">​</a></h2><p>​ 在这儿你可以看到所有你账号被分配的用户组，以及针对你账号实际的一些策略显示总和。</p><h2 id="_2-静音-拉黑" tabindex="-1">（2）静音/拉黑 <a class="header-anchor" href="#_2-静音-拉黑" aria-label="Permalink to &quot;（2）静音/拉黑&quot;">​</a></h2><p>​ 你希望屏蔽什么文字、什么关键词、屏蔽哪个服务器、静音用户（还是静音用户转发的）、拉黑用户。</p><div class="note custom-block github-alert"><p class="custom-block-title">NOTE</p><p></p><p>​ 静音只是默认不显示，但是可以主动去找到看，对方此时也可以正常看你的（只要他没额外设置）；拉黑是对方不能看你的了，你不主动去看对方也看不到对方了。</p><p>​ 屏蔽服务器后，你就看到这个服务器的内容和上面用户的回复，但是你的帖子只要没有被实例级屏蔽，依旧会正常的通讯。</p></div><h2 id="_3-api" tabindex="-1">（3）API <a class="header-anchor" href="#_3-api" aria-label="Permalink to &quot;（3）API&quot;">​</a></h2><p>​ 设置一些API，包括第三方APP的使用记录权限等。</p><h2 id="_4-webhook" tabindex="-1">（4）Webhook <a class="header-anchor" href="#_4-webhook" aria-label="Permalink to &quot;（4）Webhook&quot;">​</a></h2><p>​ 就是Webhook，用不上的人也没必要专门了解，真要了解百度一下这个概念吧。</p><h2 id="_5-导入和导出" tabindex="-1">（5）导入和导出 <a class="header-anchor" href="#_5-导入和导出" aria-label="Permalink to &quot;（5）导入和导出&quot;">​</a></h2><p>​ 在这里你可以快速导出/导入一些你的设置和内容，比如帖子、关注等。</p><h2 id="_6-账户迁移" tabindex="-1">（6）账户迁移 <a class="header-anchor" href="#_6-账户迁移" aria-label="Permalink to &quot;（6）账户迁移&quot;">​</a></h2><p>​ 在这儿你可以快速的迁移你关注中的用户到别的地方（反之也可以），迁移之前需要在对应的服务器注册账号，设定好账号别名，然后在即将迁移的账号后台中开始迁移</p><h2 id="_7-其他" tabindex="-1">（7）其他 <a class="header-anchor" href="#_7-其他" aria-label="Permalink to &quot;（7）其他&quot;">​</a></h2><p>​ 更多未分类的东西，比如注销账号就在此处。</p>',16)]))}const u=e(h,[["render",i]]);export{b as __pageData,u as default};
